import React from 'react'

import classes from './LandingBanner.module.css'

const Header = () => (
    <header className = { classes.Header }>

    </header>
)

const LandingBanner = () => (
    <div className = { classes.Banner }>
        <Header />
    </div>
)

export default LandingBanner
